import { Navbar, NavbarBrand, Image,
    NavbarItem, NavbarMenu, Container, NavbarEnd, Button
} from 'bloomer';
import { FontAwesomeIcon as Icon } from '@fortawesome/react-fontawesome';
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons'

export default function Header({ handleLogout }) { 
    return (
        <Navbar>
            <Container>
                <NavbarBrand>
                    <NavbarItem>
                        <Image isSize='24x24' src='/static/img/logo.png' />
                    </NavbarItem>
                    <NavbarItem style={{fontWeight: 300}}>Gym App</NavbarItem>
                </NavbarBrand>
                <NavbarMenu>
                    <NavbarEnd>
                        <NavbarItem>
                            <Button isOutlined isColor='primary' onClick={handleLogout}>
                            <Icon icon={faSignOutAlt}/>
                            <span>Sair</span>
                            </Button>
                        </NavbarItem>
                    </NavbarEnd>
                </NavbarMenu>
            </Container>
        </Navbar>
    );
}
